/**
 * @param {ListNode} headA
 * @param {ListNode} headB
 * @return {ListNode}
 */
var getIntersectionNode = function(headA, headB) {
    if(headA == null || headB == null) return
    let node1 = headA
    let node2 = headB
    while(node1 !== node2){
        node1 = node1 == null ? headB : node1.next;
        node2 = node2 == null ? headA : node2.next
    }
    return node1
};
