`,paraId:4,tocIndex:1}],cr={},mr={title:"977 \u6709\u5E8F\u6570\u7EC4\u7684\u5E73\u65B9",toc:"menu",filename:"docs/Algorithm/977.md",lastUpdated:1711475729e3,group:"\u6570\u7EC4",order:3,description:"\u7ED9\u4F60\u4E00\u4E2A\u6309 \u975E\u9012\u51CF\u987A\u5E8F \u6392\u5E8F\u7684\u6574\u6570\u6570\u7EC4 nums\uFF0C\u8FD4\u56DE \u6BCF\u4E2A\u6570\u5B57\u7684\u5E73\u65B9 \u7EC4\u6210\u7684\u65B0\u6570\u7EC4\uFF0C\u8981\u6C42\u4E5F\u6309 \u975E\u9012\u51CF\u987A\u5E8F \u6392\u5E8F\u3002"},wr=[{id:"\u9898\u5E72",depth:2,title:"\u9898\u5E72"},{id:"\u89E3",depth:2,title:"\u89E3"}],xr=[{value:"\u7ED9\u4F60\u4E00\u4E2A\u6309 \u975E\u9012\u51CF\u987A\u5E8F \u6392\u5E8F\u7684\u6574\u6570\u6570\u7EC4 nums\uFF0C\u8FD4\u56DE \u6BCF\u4E2A\u6570\u5B57\u7684\u5E73\u65B9 \u7EC4\u6210\u7684\u65B0\u6570\u7EC4\uFF0C\u8981\u6C42\u4E5F\u6309 \u975E\u9012\u51CF\u987A\u5E8F \u6392\u5E8F\u3002",paraId:0,tocIndex:0},{value:`/**
 * @param {number[]} nums
 * @return {number[]}
 */
var sortedSquares = function (nums) {
  const numsLength = nums.length;
  if (!numsLength) return -1;
  let newNum = [];
  let left = 0;
  let right = numsLength - 1;
  while (left <= right) {
    let numleft = Math.abs(nums[left]);
    let numright = Math.abs(nums[right]);
    if (numleft <= numright) {
      newNum.unshift(Math.pow(numright, 2));
      right--;
    } else if (numleft > numright) {
      newNum.unshift(Math.pow(numleft, 2));
      left++;
    }
  }
  return newNum;
};
